import React, { useEffect, useState } from 'react';
import {Typography,Link,Grid} from '@mui/material';
import EastIcon from '@mui/icons-material/East';
import './homeStyles.scss'
import { PostJobListFilter } from '../../sevices/job';
import {ExploreCardLoader} from '../loaders/loaders'
import { useNavigate } from 'react-router-dom';
import moment from 'moment';
import { EmployeeSubscriptionView, EmployerSubscriptionView } from '../../sevices/account';

const ExploreCard=()=> {
  const [joblist, setJoblist] = useState([]);
  const [isLoading, setIsLoading] = useState(false);
  const [metaData, setMetaData] = useState({});
  const [page, setPage] = useState(1);
  const [selectedValue, setSelectedValue] = useState(joblist.map(() => "0"));

  const containerRef = document.getElementById('container');

  const navigate = useNavigate ();


  useEffect(() => {
    fetchJobData();
    //SubscriptionView()
}, [])


const SubscriptionView = async () => {  
  try {
      const View = await EmployeeSubscriptionView({})
  } catch (error) {
      console.error('BCKCghmgN2:', error);
    ///  navigate("/employee-subscription?roles=employee")
  }

}

const fetchJobData = async (page = 1) => {
  setIsLoading(true);
  try {
      let body ={};
      body.page=1;
      body.limit=8;

      const response = await PostJobListFilter(
        body
      );
      if (response?.status === 200) {
          const jobItems = response?.data?.items;
          const jobMeta = response?.data?.meta;
          const nextPage = page + 1;
          setPage(nextPage);
          jobItems?.length && setJoblist(prevJobList => [...prevJobList, ...jobItems]);
          setMetaData({...jobMeta});
      }

  } catch (error) {
      console.log('Error fetching job data:', error);
      return [];
  } finally {
    setIsLoading(false);
  }
};

const handleScroll = () => {
  if (
      containerRef &&
      containerRef.scrollTop + containerRef.clientHeight >= containerRef.scrollHeight
  ) {
      handleFetchJobsForScroll();
  }
};
const handleFetchJobsForScroll = () => {
  const totalJobCount = metaData?.total ? metaData?.total: 0;
  if (!isLoading && totalJobCount !== joblist?.length) {
      fetchJobData(page);
  }
}
if (containerRef) {
  containerRef.addEventListener('scroll', handleScroll);
} else {
}

    return (
      <div className='full-width' id="container">
      <div className="exploreCardContainer">


      <Grid container spacing={2.5}>
        {isLoading ? <ExploreCardLoader/> :
        <>
        {joblist && joblist.map(ele => {
          return (
            <>
            <Grid item xs={12} sm={6} md={4} lg={3}> 
              <div className="exploreCard">
                <div className="exploreCardHeader">
                {ele?.employer_profile?.company_logo ? <img src={`https://s3.ap-south-1.amazonaws.com/parttimer/public/images/company_logo/512/${ele?.employer_profile?.company_logo}`} className="exploreCardHeaderImg" /> : <img src={require("../../assets/images/default-logo1.png")} className="exploreCardHeaderImg" />}
                  <div className="exploreCardHeaderNameDomain">
                    <span className="exploreCardHeaderName">{ele?.employer_profile?.company_name}</span>
                    <span className="exploreCardHeaderDomain">{ele.city}</span>
                  </div>
                </div>
                <div className="exploreCardBody">
                  <div className="exploreCardBodyTitle">{ele.title}</div>
                  <Typography
                    variant="body1">
                   {ele?.job_description}
                  </Typography>
                </div>
                <div className="exploreCardFooter">
                  <span className="exploreCardFooterAmount">
                  {ele?.job_salary}/<small>/{moment(ele?.job_timing_slot, "HH:mm a").format("HH")} hrs</small>
                  </span>
                  <Link href={`/descriptionjob?id=${ele.id}`} className="exploreCardFooterLink">
                    <span>Apply now</span>
                    <EastIcon />
                  </Link>
                </div>
              </div>
            </Grid>
            </>
          )
        })}
        </>
        }
      </Grid>
    </div>
    </div>
    )
}
export default ExploreCard;
